import React, { Component } from "react";
import { Link } from "react-router-dom";
import "../style/Course.css";
import "../App.css";

//test
import contestList from "./test-data"; 

// import { Container, Form }from 'react-bootstrap'
// import 'bootstrap/dist/css/bootstrap.min.css'

export default class ContestPortal extends Component {

  constructor(props){
    super(props);
    this.state = {
      ques : this.props.Ques ,
      count : 0
    };
  }


  
  render() {
    
    const codebtn = {
      border: "2px solid white",
      width: "13%",
      display: "flex",
      justifyContent: "center",
      alignItems: "center"
    }


    return (
      <>
        <br />
        <div className="firsthead">
          <h1 style={{ color: "darkslategray", display: "inline-block" }}>
            Contest Portal{" "}
          </h1>
          <button value="Add Questions" id="rd_btn" >
            <Link to="/createContest" style={{ color: "darkslategray" }}>
              {"Add Questions"}
            </Link>{" "} 
          </button> 
        </div> <br/>

        <div className="practiceques">

        <div className="Ques-box" style={{display:"flex"}}>
          {
            contestList.map(contest => {
              return(
           
          <div className="Question" id={this.state.count + 1} > 
          <p>{contest.ContestID}</p>
                  <p>{contest.ContestTitle}</p>
                  <p>{contest.ContestStatus}</p>
          
          </div>
              )
            })
          }
          <Link to="/compiler" style={codebtn} >  Code </Link>
        </div>
        </div>
      </>
    );
  }
}
